import { useState } from "react";

import { useNavigate, Link } from "react-router-dom";

import {
  FaUser,
  FaLock,
  FaGoogle,
  FaFacebook,
  FaEnvelope,
} from "react-icons/fa";
import "./AuthPage.css"; 
import React from "react";

export default function AuthPage() {
  const [isSignup, setIsSignup] = useState(false);
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [username, setUsername] = useState("");
  const [userType, setUserType] = useState("buyer");

  const handleLogin = () => {
    if (email === "test@gmail.com" && password === "Test1234") {
      navigate("/Dashboard");
    }else {
      alert("Invalid email or password. Please try again.");}
  };

  const handleAuth = () => {
    console.log(
      isSignup ? "Signing up" : "Logging in",
      email,
      password,
      username,
      userType
    );
  };

  return (
    <div className="auth-container">
      <h2>{isSignup ? "Create an Account" : "Welcome"}</h2>
      <p>
        {isSignup
          ? "Sign up to start bidding and selling!"
          : "Secure login to your account"}
      </p>

      {isSignup && (
        <div className="input-group">
          <FaUser />
          <input
            type="text"
            placeholder="Username"
            value={username}
            onChange={(e) => setUsername(e.target.value)}
          />
        </div>
      )}

      <div className="input-group">
        <FaEnvelope />
        <input
          type="email"
          placeholder="Email"
          value={email}
          onChange={(e) => setEmail(e.target.value)}
        />
      </div>

      {/* Password Input */}
      <div className="password-input-container">
        <FaLock />
        <input
          type={showPassword ? "text" : "password"}
          placeholder="Password"
          value={password}
          onChange={(e) => setPassword(e.target.value)}
          className="password-input"
          aria-label="Password"
        />
        <span
          className="toggle-icon"
          onClick={() => setShowPassword(!showPassword)}
        >
          {showPassword ? <FaEyeSlash /> : <FaEye />}
        </span>
        
      </div>

      {isSignup && (
        <div className="input-group">
          <select
            value={userType}
            onChange={(e) => setUserType(e.target.value)}
          >
            <option value="buyer">Buyer</option>
            <option value="seller">Seller</option>
          </select>
        </div>
      )}

      <div className="action-links">
        {!isSignup && <a href="#">Forgot Password?</a>}
        <a href="#" onClick={() => setIsSignup(!isSignup)}>
          {isSignup ? "Already have an account? Login" : "New here? Sign Up"}
        </a>
      </div>

      <button onClick={handleAuth} className="auth-btn">
        {isSignup ? "Sign Up" : "Login"}
      </button>

            {/* Login Button */}
      <button onClick={handleLogin} className="login-btn">
        Login
      </button>

      <div className="oauth-buttons">
        <button>
          <FaGoogle /> Google
        </button>
        <button>
          <FaFacebook /> Facebook
        </button>
      </div>

      <p className="security-msg">
        🔒 Secure authentication with SSL encryption
      </p>
    </div>
  );
}
